import React from 'react';

function Clock(props) {
    const time = new Date();
    console.log(time.toDateString());

    return(
        <div>
            
            <p>{time.toDateString()}</p>
            <p>{time.getUTCHours()}</p>
        </div>
    );
}

export default Clock;
